import React, { useState } from 'react'
import styled from 'styled-components'
import HomeMyStocksMainHeader from './HomeMyStocksMainHeader'
import HomeMyStocksInfo from './HomeMyStocksInfo'



const HomeMyStocksMain = () => {

  const Container = styled.div`
    padding-bottom: 1rem;

  `;

  const Main = styled.div`
    height: 100%;
    margin-bottom: 2rem;
  display: flex;
    `;
  const StaticLeftColumn = styled.div`
    overflow: hidden;
    width: 150px;
    font-size: 14px;
    padding-left: 2rem;

`;
  const StaticItem = styled.div`
    height: 100%auto;
  `;
  const OverflowXDiv = styled.div`
overflow-x: auto;
/* overflow-y: hidden; */
`;
  return (
    <Container>
      <Main>
        <StaticLeftColumn>

          <StaticItem>symbol</StaticItem>
          <StaticItem>AAPL</StaticItem>
          <StaticItem>MSFT</StaticItem>
        </StaticLeftColumn>
        <OverflowXDiv>
          <HomeMyStocksMainHeader />
          <HomeMyStocksInfo />



        </OverflowXDiv>





      </Main>

    </Container>
  )
}

export default HomeMyStocksMain
